import './App.css';
import Homepage from './Homepage';

import { Router, Routes, Route } from 'react-router-dom';


function App() {
  return (
<Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/bank-connect" element={<BankConnect />} />
      </Routes>
    </Router>

  );
}

export default App;
